import { Component } from '@angular/core';

@Component({
  selector: 'home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.css'],
})
export class HomeComponent {}
<div class="container">
  <about id="about"></about>
  <exp id="exp"></exp>
  <projects id="projects"></projects>
  <contact id="contact"></contact>
</div>
